import React from "react";
import { Link } from "react-router-dom"; 

export default function Post() {

  const markdownFiles = [
    {name : "카테고리1", post :[
    { name: "대학공부", content: "내용1" }, 
    { name: "유니티", content: "내용2" }
    ]},
    {name : "카테고리2", post :[
      { name: "대학공부", content: "내용1" }, 
      { name: "유니티", content: "내용2" }
      ]}
  ]

  //페이지 데이터 받아서 글자 출력  
  return (
    <div>
        <h2>글</h2>
    <div>
      {markdownFiles.map((folder, index) => (
        <Link
          key={index}
          to={`/blog/${folder.name}`}
        >
          <h3>{folder.name}</h3>
          <p>{folder.content}</p> 
          <Link>
          </Link>
        </Link> 
      ))}
    </div>
    </div> 
  );
  
}
